// Following.jsx
import React from 'react';

const Following = ({ followingList }) => {
  return (
      <div className="following">
          {followingList.map(user => (
              <a key={user.id} href={`/user/${user.id}`} className="user-link">
                  {user.name}
              </a>
          ))}
      </div>
  );
};


export default Following;
